;; **
;;; ## 3.1 Matching semantics
;;; 
;;; ### Injective vs non-injective matches
;;; 
;;; Rules may be defined to use **_injective_** or **_non-injective** matching semantics. Non-injective matching semantics is the default, and allows different graph elements in the rule to match the _same_ graph elements in the graph that the rule is applied to. To understand this better, consider a graph (`g1`) with one `Hello` node:
;; **

;; @@
(def g1 (-> (newgrape) hello))
(view g1)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"429\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x58ff94b6 \"BufferedImage@58ff94b6: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 429 height = 133 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x58ff94b6 \"BufferedImage@58ff94b6: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 429 height = 133 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 429, :height 133})"}
;; <=

;; **
;;; Now consider the following rule. It creates a  relationship `rel` between "two" `Hello` nodes. 
;; **

;; @@
(rule rel []
   (read 
      (node h:Hello)
      (node h2:Hello))
   (create 
  	  (edge e:rel h h2)))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"139\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5ad86806 \"BufferedImage@5ad86806: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 139 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Is this rule applicable to graph `g1`? The answer to this question depends on the matching semantics. If **_non-injective_** matches are allowed, the two `Hello` nodes in rule `rel` may in fact be matched to the _same_ node in the graph the rule is applied to. 
;;; 
;;; The match is illustrated in the following figure:
;;; 
;;; ![](https://github.com/jenshweber/grape/blob/master/help/match.png?raw=true)
;;; 
;;; 
;;; Applying this rule will result in a node with a `rel` edge to itself:
;; **

;; @@
(view (rel g1))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"427\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0xd284c37 \"BufferedImage@d284c37: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@2f1bbd78 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 133 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0xd284c37 \"BufferedImage@d284c37: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@2f1bbd78 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 133 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 427, :height 133})"}
