;; **
;;; ### 4.1.2 Mixed matching semantics
;;; 
;;; At times we may want to allow non-injective matches for parts of the rule but enforce an injective constraint for another part of the rule. This can be done by specifying __application conditions__. We will talk aboout application conditions later in this tutorial. However, as a preview, here is a rule (`rel3`) that uses an application condition to ensure that two different nodes are matched. Since `rel3` only has two nodes, its semantics is the same as that of rule `rel2`:
;; **

;; @@
(rule rel3 [] 
   (read
       (node h:Hello)
       (node h2:Hello)
       (condition "not h=h2"))
   (create 
       (edge :rel h h2)))
