;; **
;;; ## 4.2 Alternative matches and equivalence
;;; 
;;; Consider the above example of graph `g2` again. Is there only one possible way to apply rule `rel2`? Indeed, there are **two** possible ways to apply that rule. The roles of the two nodes could also have been reversed, which would create the relationship in the _opposite_ direction. The two alternative matches (@@m_1@@ and @@m_2@@) are illustrated in the following picture:
;;; 
;;; ![](https://github.com/jenshweber/grape/blob/master/help/match2.png?raw=true)
;;; 
;;; Knowing that there are two alternative matches for rule `rel2` in graph `g2` means that there could also be two alternative graph outputs of the rule (i.e., two graphs where the relationship is created in opposite direction). Still, the application of `rel2` produced only a single result. The reason for this is that the two resulting graphs would be equivalent (identical _up to isomorphism_). 
;;; 
;;; If we really want to compute all possible graphs (even if they are equivalent), we can use **starred rule application**.
;;; 
;;; ## 4.3 Starred rule applications
;;; 
;;; In addition to the default rule applications, which computes results that are unique up to isomorphism,  @@GrapeVine@@ provides __starred rule applications__. 
;;; 
;;; A starred rule application applies a rule so that _all_ possible matches are performed, even if the computed graphs are indistinguishable. This generates a _set_ of graphs, where each graph represents the result of a possible rule application. The output is a @@grape@@, which contains more than a single graph. (See Section 2.1)
;;; 
;;; > _Note: this is the point in the tutorial when we start talking about "@@grapes@@" (**grap**h **e**numerations) rather than graphs when referring to the input or output of operations._
;;; 
;;; Invoking a starred rule is simply done by adding an asterisk after the rules name:
;; **

;; @@
 (rel2* g2)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;91e0b000-d8fd-45ec-93d1-629116ef7903&quot;</span>","value":"\"91e0b000-d8fd-45ec-93d1-629116ef7903\""},{"type":"html","content":"<span class='clj-string'>&quot;a5a3fa53-15b9-4740-bd22-700ef7d2ae4b&quot;</span>","value":"\"a5a3fa53-15b9-4740-bd22-700ef7d2ae4b\""}],"value":"(\"91e0b000-d8fd-45ec-93d1-629116ef7903\" \"a5a3fa53-15b9-4740-bd22-700ef7d2ae4b\")"}
